import React from 'react';
import { Slide } from 'react-slideshow-image';


const slideImages = [
  {
    url: 'https://atifmoin19.github.io/PORTFOLIO/resources/clicks/1.jpeg',
    caption: 'Slide 1'
  },
  {
    url: 'https://atifmoin19.github.io/PORTFOLIO/resources/clicks/2.jpeg',
    caption: 'Slide 2'
  },
  {
    url: 'https://atifmoin19.github.io/PORTFOLIO/resources/clicks/3.jpeg',
    caption: 'Slide 3'
  },
];

const Slideshow = () => {
    return (
      <div className="slide-container">
        <Slide>
         {slideImages.map((slideImage, index)=> (
            <div className="each-slide" key={index}>
              <div className='Imgheight' style={{'backgroundImage': `url(${slideImage.url})`}}>
                <span>{slideImage.caption}</span>
              </div>
            </div>
          ))} 
        </Slide>
      </div>
    )
}
export default Slideshow;
